import React from "react";
import "./NavBar.css"
import Logo from "./Logo";
import SearchBar from "./SearchBar";
import CreateButton from "./CreateButton";

function NavBar() {
    return ( <>
    <div className="navbar-container">
<Logo />
<SearchBar />
<CreateButton />
    </div>
    </> );
}

export default NavBar;
